const e=JSON.parse('{"key":"v-03c8fe73","path":"/lc138.html","title":"138. 复制带随机指针的链表","lang":"en-US","frontmatter":{"tag":"链表"},"headers":[{"level":2,"title":"思路","slug":"思路","link":"#思路","children":[]},{"level":2,"title":"代码","slug":"代码","link":"#代码","children":[]}],"git":{"createdTime":1686140065000,"updatedTime":1686140065000,"contributors":[{"name":"wildpants","email":"492843674@qq.com","commits":1}]},"readingTime":{"minutes":1.9,"words":570},"filePathRelative":"lc138.md","localizedDate":"June 7, 2023","excerpt":"<h1> 138. 复制带随机指针的链表</h1>\\n<p>给你一个长度为 n 的链表，每个节点包含一个额外增加的随机指针 random ，该指针可以指向链表中的任何节点或空节点。</p>\\n<p>构造这个链表的&nbsp;深拷贝。&nbsp;深拷贝应该正好由 n 个 全新 节点组成，其中每个新节点的值都设为其对应的原节点的值。新节点的 next 指针和 random 指针也都应指向复制链表中的新节点，并使原链表和复制链表中的这些指针能够表示相同的链表状态。复制链表中的指针都不应指向原链表中的节点 。</p>\\n<p>例如，如果原链表中有 X 和 Y 两个节点，其中 X.random --&gt; Y 。那么在复制链表中对应的两个节点 x 和 y ，同样有 x.random --&gt; y 。</p>"}');export{e as data};
